import React from 'react'
import { Image, Divider, Segment } from 'semantic-ui-react'
import iunnologo from './iunnologo.png'

export default class Header extends React.Component {

    render() {

        return (
            <>
            <Segment basic clearing>
                <center>
                    <Divider hidden/>
                    <Image src={iunnologo} />
                </center>

            </Segment>
        </>

        )
    }

}
